    } else if (JSON.stringify(o) === JSON.stringify(form))
    {   setFormTrue(false)
    } else{  
       setFormTrue(true)}
   }; */

   const handleClick2 = () => {
      return setFormTrue(false)
   };
  
    
    return (
        <footer className="footer">
            <Link to="/1">
     <button type="button"  className={formTrue ? 'btn-flash' : 'ftabs'}>
          Add Car
     </button>
 </Link>
 <Link to="/2">
     <button className="ftabs" type="button" onClick={handleClick}  >
          Cars
     </button>
 </Link>
 <Link to="/3">
     <button className="ftabs" type="button" onClick={handleClick} >
          Request
     </button>
 </Link>
 <Link to="/4">
     <button className="ftabs" type="button" onClick={handleClick} >
          Pulls
     </button>
 </Link>
 <Link to="/5">
     <button className="ftabs" type="button" onClick={handleClick}  >
          OutnReturning
     </button>
 </Link>
 <Link to="/6">
     <button className="ftabs" type="button" onClick={handleClick}  >
          Completed
     </button>
 </Link>
 <Link to="/7">
     <button className="ftabs" type="button" onClick={handleClick}  >
          Report
     </button>
 </Link>
 <Link to="/8">
     <button className="ftabs" type="button" onClick={handleClick}  >
          Settings
     </button>
 </Link>
 <Link to="/9">
     <button className="ftabs" type="button" onClick={handleClick}  >
          Click Me!
     </button>
     </Link>
 <Link to="/10">
     <button className="ftabs" type="button" onClick={handleClick}  >
          Click Me!
     </button>
    </Link>
   
     </footer>
    );
}
export default TabFooter
